import React, {useEffect} from "react";
import PropTypes from 'prop-types';
import { connect } from "react-redux";
import { getProfile } from "../../actions/profileAction";
import Spinner from "../Layout/Spinner";

const Dashboard = ({ getProfile, auth: { user }, profile: {profile, loading} }) => {

    useEffect(() => {

        getProfile();

    }, []);

    return(

       loading && profile === null ? <Spinner /> : <React.Fragment>

        <h1 className="large text-primary">Dashboard</h1>
       <p className="lead">
           <i className="fas fa-user-alt"></i> Welcome { user && user.name}
       </p>

       {profile !== null ? (<React.Fragment></React.Fragment>) : 
       
       (
       <React.Fragment>
        <p>You don't have your profile yet! C</p>
       </React.Fragment>
       
       )}
       </React.Fragment>
    )
};

Dashboard.propTypes = {

    getProfile: PropTypes.func.isRequired,
    auth: PropTypes.object.isRequired,
    profile: PropTypes.object.isRequired
}

const mapStateToProps = state => ({

    profile: state.profile,
    auth: state.auth
})

    


export default connect(mapStateToProps, { getProfile }) (Dashboard);
